import React from 'react';

const ContactMePage = () => (
 <>
    <h1>Contact me</h1>
    Feel free to contact me regarding anything (including your thoughts on this site :) 
    <br />Or, contact me through email: <a class="coloredLink" href="mailto:staceyleetsaihsun@gmail.com">staceyleetsaihsun@gmail.com</a>

    <form>
       <label for="yourName">Your name:</label><br />
       <input placeholder="Format: First Last"/>

       <label for="yourEmail">Your email:</label><br />
       <input type="email" placeholder="Please type in a valid address"/>


    </form>
 </>
);

export default ContactMePage;
